import { useState } from "react"
const Contador2 = () => {

    let [contador, setContador] = useState(1);



    const incrementar = () => {
            setContador(contador + 1)
    }

  return (

    <div className="container my-5" >
        <h2>Counter</h2>
        <hr />
        <button className="btn btn-primary" onClick={incrementar} >CLICK ACA BRO</button>
        <hr />
        <p>{contador}</p>
    </div>
  )
}
export default Contador2
